// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
    * @title Vit minting function 
    1. a ch no to ra NFT 
    2. Theo di NFT ids coi c to ra my ln
    3. Ai l ch s hu
    4. Xem ai s hu bao nhiu NFT
    5. to 1 event emits a tranfer log - contract address, from, to, token id
 */


contract ERC721{

     //to 1 event emits a tranfer log - contract address, from, to, token id
    event Transfer(
        address indexed from, 
        address indexed to , 
        uint256 indexed tokenId);

    // a ch no to ra NFT
    mapping (uint256 => address) private _tokenOwner;

    //a ch s hu bao nhiu NFT
    mapping (address => uint256) private _OwnerTokensCount;

    /// @notice Count all NFTs assigned to an owner
    /// @dev NFTs assigned to the zero address are considered invalid, and this
    ///  function throws for queries about the zero address.
    /// @param _owner An address for whom to query the balance
    /// @return The number of NFTs owned by `_owner`, possibly zero
    function balanceOf(address _owner) public view returns (uint256){
        require (_owner!= address(0), 'Owner is not exist');
        return _OwnerTokensCount[_owner];
    }

    /// @notice Find the owner of an NFT
    /// @dev NFTs assigned to zero address are considered invalid, and queries
    ///  about them do throw.
    /// @param _tokenId The identifier for an NFT
    /// @return The address of the owner of the NFT
    function ownerOf(uint256 _tokenId) external view returns (address){
        address owner = _tokenOwner[_tokenId];
        require(owner != address(0), 'Owner is not exist');
        return owner;
    }


    function _exist (uint256 tokenId) internal view returns (bool) {
        address owner = _tokenOwner[tokenId];
        return owner != address(0);
    }

    function _mint(address to, uint256 tokenId) internal virtual{
        //yu cu a ch khc 0
        require(to != address(0), 'ERC721: minting to the null address');
        
        //kim tra xem tokenid  tn ti hay cha
        require(!_exist(tokenId), 'This token is already exist');

        //a ch s hu token
        _tokenOwner[tokenId] = to;

        //s lng token ca 1 a ch
        _OwnerTokensCount[to]++;

        //gi event
        emit Transfer(address(0), to, tokenId);
        
    }

   
}

